import React from 'react';
import './App.css';

import Jumbotron from './allComponents/jumbotron.component.js';
import Nav from './allComponents/nav.component.js';
import TextBox from './allComponents/textBox.component.js';
import Tile from './allComponents/clickTile.component.js';

import micros from './imgs/microgreens/micro3.jpeg';
import natives from './imgs/landscapes3.jpg';
import team from './imgs/team.jpg';

function App(){

  var Nav1 = [
    'Home',
    'Microgreens',
    'Native Plants',
    'Our Team'
  ]
  var Nav1Ad = [
    '#',
    '#micro'
  ]

  return (
    <div className="App">
      <header className="App-header">
      <Nav/>


        <p>
          This will soon be EUG
        </p>
        <a
          className="App-link"
          href="http://evogrows.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn about EUG
        </a>
      </header>
    </div>
  );
}

export default App;
